import React , {Component} from 'react';

import './index.css'

const client = new ApolloClient({
  uri:'http://localhost:4000/graphql'
})
class App extends Component {
  render(){
    return (
      <ApolloProvider   client={client}>
        <div   id="main" >
         <h1>New App</h1>

        </div>
      </ApolloProvider>
    );
  }

}

export default App;
